// se.js
const SE = {
  enabled: true,
  volume: 0.5,
  sounds: {},
  volumes: {}
};

/**
 * SEをロード
 * @param {string} name - SE名
 * @param {string} src - ファイルパス
 */
function loadSE(name, vol, src) {
  const audio = new Audio(src);
  audio.preload = "auto";
  SE.sounds[name] = audio;
  SE.volumes[name] = vol;
}

function loadSEbase64(name, vol, b64) {
  const audio = new Audio("data:audio/mp3;base64," + b64);
  audio.preload = "auto";
  SE.sounds[name] = audio;
  SE.volumes[name] = vol;
}

/**
 * SEを再生
 * @param {string} name
 * @param {number} vol (0.0〜1.0)
 */
function playSE(name, vol = SE.volume) {
  if (!SE.enabled) return;

  const base = SE.sounds[name];
  if (!base) return;

  const audio = base.cloneNode();
  audio.volume = vol * SE.volumes[name];
  audio.play().catch(() => {});
}

/**
 * SE ON / OFF
 */
function setSEEnabled(flag) {
  SE.enabled = flag;
}

/**
 * 全体音量変更
 */
function setSEVolume(v) {
  SE.volume = Math.max(0, Math.min(1, v));
}

loadSEbase64("deal", 0.1, "");
loadSEbase64("win", 1.0, "");
loadSEbase64("lose", 1.0, "");
loadSEbase64("victory", 1.0, "");
loadSEbase64("up", 0.1, "");
